int ash(string input) {
    
    int hash =0;
    for (int i = 0; i < input.size(); i++)
    {
        hash += (1LL*pow1[i]*input[i])%mod;
        
    }
    hash = (hash + mod)%mod;

    return hash;
    
}

Dict::object::object() {
    sentence = "";
    count = 0;
}

Dict::object::object(string sent) {
    sentence = sent;
    count = 1;
}

Dict::object::~object() {
}


vector<string> ppr(std::string pat) {

    vector<string> ret;
    string word = "";
    for (int i = 0; i < pat.size(); i++) {
        char s = pat[i];

        if( s == '!' || s == '\"' || s == '[' || s == '.' || s == ',' || s == '?' ||
            s == ']' || s == '(' || s == ')' || s == '@' || s == ';' || s == ':' || 
            s == '\'' || s == '-' || s == ' ')
            {
                if(word.size() !=0)
                {
                    ret.push_back(word);
                    word = "";

                }

            }
        
        else {
            if(s - 'A' >=0 and s - 'Z' <= 0) {
                word += (char)(s + 32);

            }

            else{word += s;}
        }
    }

    if(word.size() !=0) {
        ret.push_back(word);
        word = "";
    }

    return ret;
    
}


